using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Threading.Tasks;
using VisitorTrackerStatelessService.Model;
using VisitorTrackerStatelessService.StorageModel;
using Domain = VisitorTrackerStatelessService.Model;
using Storage = VisitorTrackerStatelessService.StorageModel;

namespace VisitorTrackerStatelessService.Mappers
{
    public static class Mapper
    {
        public static Visitors ConvertVisitorDomainModelToStorage(VisitorModel visitorModel)
        {
            string filepath = string.Empty;string myfilename = string.Empty;
            Visitors storageVisitors = new Visitors();
            try
            {
                //string strm = "";
                    //"";

                //this is a simple white background image
                 myfilename = string.Format(@"{0}", Guid.NewGuid().ToString().Replace("-", ""));

                //Generate unique filename
                 filepath = @"F:\DailyBk_FIle\FabricApplication_BackUp\FabricApplication\FabricApplication\PlayerImages/" + myfilename + ".jpg";
                 var bytess = Convert.FromBase64String(visitorModel.VisitorImage);
               // var bytess = Convert.FromBase64String(strm);
                using (var imageFile = new FileStream(filepath, FileMode.Create))
                {
                    imageFile.Write(bytess, 0, bytess.Length);
                    imageFile.Flush();
                }

               
                storageVisitors.ContactPerson = visitorModel.ContactPerson;
                storageVisitors.ContactPersonEmail = visitorModel.ContactPersonEmail;
                storageVisitors.From = visitorModel.From;
                storageVisitors.Id = Guid.NewGuid();
                storageVisitors.Location = visitorModel.Location;
                storageVisitors.MobileNumber = visitorModel.MobileNumber;
                storageVisitors.Purpose = visitorModel.Purpose;
                storageVisitors.VisitorImage = myfilename + ".jpg";   //visitorModel.VisitorImage;
                storageVisitors.VisitorName = visitorModel.VisitorName;
                storageVisitors.VisitTime = visitorModel.VisitTime;
                return storageVisitors;
            }
            catch(Exception ex) { return storageVisitors; }
            
        }

        public static VisitorCollection ConvertVisitorStorageToDomainModel(Visitors visitorStorageModel)
        {
            VisitorCollection collection = new VisitorCollection();
            collection.ContactPerson = visitorStorageModel.ContactPerson;
            collection.ContactPersonEmail = visitorStorageModel.ContactPersonEmail;
            collection.From = visitorStorageModel.From;
            collection.MobileNumber = visitorStorageModel.MobileNumber;
            collection.Purpose = visitorStorageModel.Purpose;
            collection.VisitorImage = "http://172.25.29.35:808/PlayerImages/"+ visitorStorageModel.VisitorImage +"";
            collection.VisitorName = visitorStorageModel.VisitorName;
            collection.VisitTime = visitorStorageModel.VisitTime;
            return collection;
        }

        public static Domain.Contact ConvertContactStorageToDomainModel(Storage.Contact contactStorageModel)
        {
            Domain.Contact domainContact = new Domain.Contact();
            domainContact.ContactPersonName = contactStorageModel.ContactPersonName;
            domainContact.EmailAddress = contactStorageModel.EmailAddress;
            domainContact.SkypeId = contactStorageModel.SkypeId;
            return domainContact;
        }
    }
}
